import { createContext } from "react";
import CompTitle from "./CompTitle";
import CompOutput from "./CompOutput";
import CompBtn from "./CompBtn";

const AppContext = createContext()

function App() {
  return (
    <AppContext.Provider>
      <CompTitle/>
      <hr />
      <CompOutput/>
      <hr />
      <CompBtn/>
      </AppContext.Provider>
  );
}

export default App;
